## Executive Summary

### Business Objective
Automate the complete merchant onboarding process by integrating MPA web form data with TSYS Express (account creation) and TSYS Portfolio Pricing Manager (pricing configuration), eliminating manual data entry and reducing onboarding time from days to minutes.

### Integration Flow
```

   MPA Web Form    TSYS Express          TSYS       
   (React/Next)           (Account                     PPM        
                           Creation)                (Pricing)     




  Form Data                Bank Number                 Fee Configuration
  Validation               Merchant Number             DDA Setup
  10-Step Wizard           Boarding Status             Rate Schedules
```

### Critical Dependencies
1. **Merchant must exist in Express before PPM configuration**
2. **Merchant must be "Boarded" (status = B) before pricing**
3. **BankNum + MerchantNum are required identifiers for PPM**

### Success Criteria
-  Zero manual data entry for merchant onboarding
-  End-to-end onboarding in < 5 minutes (excluding underwriting)
-  100% data accuracy between MPA  Express  PPM
-  Comprehensive audit trail for compliance
-  Real-time error handling and user feedback

---

## Integration Architecture

### System Overview

```

                        TSYS CRM Application                           
                      (React 19 + Next.js 15)                         


                                    MPA Form Data


                     Integration Orchestration Layer                   
                      (Next.js Server Actions)                         

   MPA Data Validation                                                
   Express Account Creation                                           
   Boarding Status Polling                                            
   PPM Pricing Configuration                                          
   DDA Account Setup                                                  
   End-to-End Validation                                              





   TSYS Express API                     TSYS PPM API               
   (XML over HTTPS)                  (SOAP/XML WSDL)               

  AddMerchant                      SaveMerchantPricing           
  AddPPMMerchant                   AddMerchantFees               
  ViewMerchant                     ModifyMerchantFees            
  AddTerminal                      SaveMerchantDDA               
  MaintainMerchantBETs             GetMerchantPricing            
  AddDiscoverReg                   ApplyTemplatesToMerchant      
  AddAmexOptBlueReg                AddErg                        

```

### Technology Stack

**Frontend:**
- React 19 (useActionState, useOptimistic, useFormStatus)
- Next.js 15 App Router
- TypeScript (strict mode)
- React Hook Form + Zod validation
- TanStack Query (server state)
- Zustand (client state)

**Backend:**
- Next.js Server Actions
- Node.js SOAP client (`soap` npm package)
- XML parsing (`fast-xml-parser`)
- HTTP client (axios with retry logic)

**Integration:**
- TSYS Express XML API (custom XML over HTTPS)
- TSYS PPM SOAP API (WSDL-based)
- PostgreSQL (Neon) for audit logging
- Redis (optional) for caching boarding status

**Security:**
- NextAuth.js v5 for user authentication
- Field-level encryption for PII
- HTTPS for all API communications
- Secret management via environment variables

