## Phase 1: Express Account Creation

### 1.1 Overview

**Purpose:** Create merchant account in TSYS Express system and obtain BankNum + MerchantNum identifiers.

**API Method:** `AddPPMMerchant` (recommended) or `AddMerchant`

**Why AddPPMMerchant?**
- Creates merchant in both Express AND PPM simultaneously
- Reduces integration complexity
- Single point of failure vs. two-step process
- Recommended by TSYS for PPM-enabled clients

### 1.2 Data Mapping: MPA  Express

#### Merchant Demographics

| MPA Field | Express Field | Required | Notes |
|-----------|--------------|----------|-------|
| `businessLegalName` | `LegalBusinessName` | Yes | Max 60 chars |
| `dbaName` | `DBAName` | Yes | Max 60 chars |
| `businessEntityType` | `EntityType` | Yes | Corporation, LLC, Sole Prop, etc. |
| `federalTaxId` | `TaxID` | Yes | EIN (9 digits) |
| `industryMCC` | `MCC` | Yes | 4-digit Merchant Category Code |
| `businessStartDate` | `BusinessStartDate` | No | MM/DD/YYYY |
| `businessDescription` | `BusinessDescription` | No | Max 255 chars |

#### Business Address

| MPA Field | Express Field | Required | Notes |
|-----------|--------------|----------|-------|
| `businessAddress.street` | `PhysicalAddress.Street` | Yes | Max 40 chars |
| `businessAddress.city` | `PhysicalAddress.City` | Yes | Max 30 chars |
| `businessAddress.state` | `PhysicalAddress.State` | Yes | 2-char code |
| `businessAddress.zip` | `PhysicalAddress.PostalCode` | Yes | 5 or 9 digits |
| `businessAddress.country` | `PhysicalAddress.Country` | Yes | US default |
| `businessPhone` | `Phone` | Yes | 10 digits |

#### Ownership Information

| MPA Field | Express Field | Required | Notes |
|-----------|--------------|----------|-------|
| `owner.firstName` | `Owner.FirstName` | Yes | Max 30 chars |
| `owner.lastName` | `Owner.LastName` | Yes | Max 30 chars |
