### 1.3 Express API Implementation

#### Service Structure

```typescript
// src/lib/services/tsys-express/client.ts

import axios, { AxiosInstance } from 'axios';
import { XMLParser, XMLBuilder } from 'fast-xml-parser';

export class TSYSExpressClient {
  private client: AxiosInstance;
  private xmlParser: XMLParser;
  private xmlBuilder: XMLBuilder;

  constructor() {
    this.client = axios.create({
      baseURL: process.env.TSYS_EXPRESS_URL,
      timeout: 30000,
      headers: {
        'Content-Type': 'application/xml',
      },
    });

    this.xmlParser = new XMLParser({
      ignoreAttributes: false,
      attributeNamePrefix: '@_',
    });

    this.xmlBuilder = new XMLBuilder({
      ignoreAttributes: false,
      attributeNamePrefix: '@_',
      format: true,
    });
  }

  async sendRequest(command: string, data: any): Promise<any> {
    const requestXML = this.buildRequest(command, data);

    const response = await this.client.post('', requestXML, {
      headers: {
        'X-Client-ID': process.env.TSYS_EXPRESS_CLIENT_ID,
      },
    });

    return this.parseResponse(response.data);
  }

  private buildRequest(command: string, data: any): string {
    const request = {
      request: {
        header: {
          client_id: process.env.TSYS_EXPRESS_CLIENT_ID,
        },
        request: {
          command,
          data: {
            '?xml': { '@_version': '1.0', '@_encoding': 'UTF-8' },
            '![CDATA': this.xmlBuilder.build(data),
          },
        },
      },
    };

    return this.xmlBuilder.build(request);
  }

  private parseResponse(xml: string): any {
    const parsed = this.xmlParser.parse(xml);

    // Check for errors
    if (parsed.response.status.error) {
      throw new ExpressAPIError(
        parsed.response.status.error,
        parsed.response.status
      );
    }

    return parsed.response;
  }
}
```

#### AddPPMMerchant Operation

```typescript
// src/lib/services/tsys-express/operations/add-ppm-merchant.ts

export interface AddPPMMerchantRequest {
  merchantDemographics: {
    legalBusinessName: string;
    dbaName: string;
    entityType: string;
    taxId: string;
    mcc: string;
    businessStartDate?: string;
  };
  address: {
    physical: Address;
    mailing?: Address;
  };
  owner: Owner;
  dda: DDAAccount;
  processingInfo: ProcessingInfo;
  cardPlans?: CardPlan[];
}

export interface AddPPMMerchantResponse {
  transactionId: string;
  bankNumber: string;
  merchantNumber: string;
  status: {
    code: string;
    message: string;
  };
}

export async function addPPMMerchant(
  client: TSYSExpressClient,
  request: AddPPMMerchantRequest
): Promise<AddPPMMerchantResponse> {
  const xmlData = transformToExpressXML(request);

  const response = await client.sendRequest('AddPPMMerchant', xmlData);

  return {
    transactionId: response.request.transaction_id,
    bankNumber: response.data.Merchant.BankNumber,
    merchantNumber: response.data.Merchant.MerchantNumber,
    status: {
      code: response.status.code,
      message: response.status.message,
    },
  };
}

function transformToExpressXML(request: AddPPMMerchantRequest): any {
  return {
    Merchant: {
      MerchantDemographics: {
        LegalBusinessName: request.merchantDemographics.legalBusinessName,
        DBAName: request.merchantDemographics.dbaName,
        EntityType: request.merchantDemographics.entityType,
        TaxID: request.merchantDemographics.taxId,
        MCC: request.merchantDemographics.mcc,
        BusinessStartDate: request.merchantDemographics.businessStartDate,
      },
      NameAddress: {
        PhysicalAddress: {
          Street: request.address.physical.street,
          City: request.address.physical.city,
          State: request.address.physical.state,
          PostalCode: request.address.physical.zip,
          Country: request.address.physical.country || 'US',
        },
        Phone: request.address.physical.phone,
      },
      Owner: {
        FirstName: request.owner.firstName,
        LastName: request.owner.lastName,
        SSN: request.owner.ssn,
        DateOfBirth: request.owner.dob,
        OwnershipPercent: request.owner.ownershipPercentage,
        Address: {
          Street: request.owner.address.street,
          City: request.owner.address.city,
          State: request.owner.address.state,
          PostalCode: request.owner.address.zip,
        },
      },
      DDA: {
        AccountNumber: request.dda.accountNumber,
        RoutingNumber: request.dda.routingNumber,
        AccountType: request.dda.accountType,
      },
      ProcessingInfo: {
        ProcessingMethod: request.processingInfo.method,
        AnnualVolume: request.processingInfo.annualVolume,
        AverageTicket: request.processingInfo.averageTicket,
        HighTicket: request.processingInfo.highTicket,
      },
    },
  };
}
```

### 1.4 Boarding Status Polling

After creating the merchant, poll for boarding confirmation before proceeding to PPM.

```typescript
// src/lib/services/tsys-express/operations/view-merchant.ts

export async function waitForBoardingStatus(
  client: TSYSExpressClient,
  bankNumber: string,
  merchantNumber: string,
  targetStatus: 'B' | 'P' = 'B',
  options: { timeout?: number; pollInterval?: number } = {}
): Promise<void> {
  const timeout = options.timeout || 300000; // 5 minutes default
  const pollInterval = options.pollInterval || 5000; // 5 seconds default

  const startTime = Date.now();

  while (Date.now() - startTime < timeout) {
    const merchant = await viewMerchant(client, bankNumber, merchantNumber);

    if (merchant.status === targetStatus) {
      return; // Success
    }

    if (merchant.status === 'D' || merchant.status === 'C') {
      throw new Error(`Merchant is deactivated or closed: ${merchant.status}`);
    }

    await sleep(pollInterval);
  }

  throw new Error('Boarding status polling timeout');
}

export async function viewMerchant(
  client: TSYSExpressClient,
  bankNumber: string,
  merchantNumber: string
): Promise<MerchantView> {
  const response = await client.sendRequest('ViewMerchant', {
    Merchant: {
      BankNumber: bankNumber,
      MerchantNumber: merchantNumber,
    },
  });

  return {
    bankNumber: response.data.Merchant.BankNumber,
    merchantNumber: response.data.Merchant.MerchantNumber,
    status: response.data.Merchant.Status,
    dbaName: response.data.Merchant.DBAName,
    // ... other fields
  };
}
```

### 1.5 Error Handling

```typescript
// src/lib/errors/express-errors.ts

export class ExpressAPIError extends Error {
  constructor(
    public code: string,
    public statusInfo: any
  ) {
    super(`Express API Error ${code}: ${statusInfo.message}`);
    this.name = 'ExpressAPIError';
  }
}

export const EXPRESS_ERROR_HANDLERS = {
  S515: 'Missing required fields - check merchant data completeness',
  S999: 'Business rule violation - check field values',
  S711: 'Invalid Client ID - check credentials',
  S721: 'Authentication failed - check user ID and password',
  S812: 'Invalid bank or unauthorized access',
  S822: 'Invalid BIN or unauthorized access',
  S404: 'Technical failure - retry with exponential backoff',
  S405: 'Record locked - retry after delay',
};

export function handleExpressError(error: ExpressAPIError): never {
  const handler = EXPRESS_ERROR_HANDLERS[error.code];

  if (handler) {
    throw new Error(`${handler} (Code: ${error.code})`);
  }

  throw error;
}
```

