## Phase 2: PPM Pricing Configuration

### 2.1 Overview

**Purpose:** Configure merchant pricing, fees, and settlement accounts in PPM after Express boarding.

**API Methods:**
- `SaveMerchantPricing` - Create pricing profile with fees
- `SaveMerchantDDA` - Configure settlement bank accounts
- `GetMerchantPricing` - Validation and retrieval

**Prerequisites:**
-  Merchant exists in Express
-  Merchant status = "B" (Boarded)
-  BankNum and MerchantNum obtained from Express

### 2.2 Data Mapping: MPA  PPM

#### Discount Fees (Category 12)

| MPA Field | PPM Configuration | Notes |
|-----------|-------------------|-------|
| `pricing.visaCreditRate` | Discount Fee: VISA/CREDIT | Percentage rate |
| `pricing.visaCreditPerTxn` | Discount Fee: VISA/CREDIT | Per-item amount |
| `pricing.visaDebitRate` | Discount Fee: VISA/DEBIT | Percentage rate |
| `pricing.mcCreditRate` | Discount Fee: MC/CREDIT | Percentage rate |
| `pricing.mcCreditPerTxn` | Discount Fee: MC/CREDIT | Per-item amount |
| `pricing.discoverCreditRate` | Discount Fee: DISCOVER/CREDIT | Percentage rate |
| `pricing.amexCreditRate` | Discount Fee: AMEX/CREDIT | Percentage rate |

#### Authorization Fees (Category 1)

| MPA Field | PPM Configuration | Notes |
|-----------|-------------------|-------|
| `pricing.authFeePerTxn` | Auth Fee: ALL | Per-item rate |
| `pricing.authFeeVisa` | Auth Fee: VISA | Card-specific |
| `pricing.authFeeMC` | Auth Fee: MC | Card-specific |

#### Monthly Fees (Category 9)

| MPA Field | PPM Configuration | Notes |
|-----------|-------------------|-------|
| `pricing.monthlyAccountFee` | MISC Fixed Fee: MONTHLY | Fixed monthly amount |
| `pricing.monthlyMinimum` | MinimumDiscount | Minimum monthly charge |
| `pricing.statementFee` | MISC Fixed Fee: STATEMENT | Monthly statement fee |
| `pricing.pciComplianceFee` | MISC Fixed Fee: PCI | Annual/monthly PCI fee |

#### Transaction Fees (Category 3)

| MPA Field | PPM Configuration | Notes |
|-----------|-------------------|-------|
| `pricing.batchFee` | Data Capture Other: BATCH | Per batch settlement |
| `pricing.chargebackFee` | Exceptions: CHARGEBACK | Per chargeback |
| `pricing.retrievalFee` | Exceptions: RETRIEVAL | Per retrieval |

### 2.3 PPM API Implementation

#### SOAP Client Setup

```typescript
// src/lib/services/tsys-ppm/client.ts

import soap from 'soap';

export class TSYSPPMClient {
  private client: soap.Client | null = null;
  private wsdlUrl: string;
  private credentials: {
    clientId: string;
    userId: string;
    password: string;
  };

  constructor() {
    this.wsdlUrl = process.env.PPM_WSDL_URL!;
    this.credentials = {
      clientId: process.env.PPM_CLIENT_ID!,
      userId: process.env.PPM_USER_ID!,
      password: process.env.PPM_PASSWORD!,
    };
  }

  async initialize(): Promise<void> {
    if (this.client) return;

    this.client = await soap.createClientAsync(this.wsdlUrl, {
      endpoint: process.env.PPM_ENDPOINT_URL,
    });

    // Add SOAP header for authentication
    this.client.addSoapHeader({
      RequestHeader: {
        ClientID: this.credentials.clientId,
        UserID: this.credentials.userId,
        Password: this.credentials.password,
      },
    });
  }

  async saveMerchantPricing(
    request: MerchantPricingRequest
  ): Promise<MerchantPricingResponse> {
    await this.initialize();

    const [result] = await this.client!.SaveMerchantPricingAsync({
      MerchantPricing: request,
    });

    if (result.ResponseMetaData.Code !== 0) {
      throw new PPMAPIError(
        result.ResponseMetaData.Code,
        result.ResponseMetaData.Description
      );
    }

    return result;
  }

  async getMerchantPricing(
    bankNum: string,
    merchantNum: string
  ): Promise<MerchantPricingResponse> {
    await this.initialize();

    const [result] = await this.client!.GetMerchantPricingAsync({
      Merchant: {
        BankNum: bankNum,
        MerchantNum: merchantNum,
      },
    });

    return result;
  }

  async saveMerchantDDA(
    request: MerchantDDARequest
  ): Promise<MerchantDDAResponse> {
    await this.initialize();

    const [result] = await this.client!.SaveMerchantDDAAsync(request);

    if (result.ResponseMetaData.Code !== 0) {
      throw new PPMAPIError(
        result.ResponseMetaData.Code,
        result.ResponseMetaData.Description
      );
    }

    return result;
  }
}
```

#### SaveMerchantPricing Operation

```typescript
// src/lib/services/tsys-ppm/operations/save-merchant-pricing.ts

import { MPAData } from '@/types/mpa';
import { MerchantPricingRequest, PPMFee } from '../types';

export async function saveMerchantPricingFromMPA(
  client: TSYSPPMClient,
  bankNum: string,
  merchantNum: string,
  mpaData: MPAData
): Promise<MerchantPricingResponse> {
  const request: MerchantPricingRequest = {
    Merchant: {
      BankNum: bankNum,
      MerchantNum: merchantNum,
    },
    MinimumDiscount: buildMinimumDiscount(mpaData),
    Fees: {
      Fee: [
        ...buildDiscountFees(mpaData),
        ...buildAuthorizationFees(mpaData),
        ...buildMonthlyFees(mpaData),
        ...buildTransactionFees(mpaData),
      ],
    },
  };

  return await client.saveMerchantPricing(request);
}

function buildMinimumDiscount(mpaData: MPAData): any {
  if (!mpaData.pricing.monthlyMinimum) return undefined;

  return {
    Amount: mpaData.pricing.monthlyMinimum,
    StartDate: formatDate(new Date()),
    StopDate: '12/31/9999',
    BillingMethod: 'D', // Deduct
    Frequency: allMonthsYes(),
    GLItemCode: 'MIN_DISC',
  };
}

function buildDiscountFees(mpaData: MPAData): PPMFee[] {
  const fees: PPMFee[] = [];
  const today = formatDate(new Date());

  // Visa Credit
  if (mpaData.pricing.visaCreditRate) {
    fees.push({
      FeeIdentity: {
        Category: 12,
        Name: 'Visa Credit Discount',
      },
      KeyStructure: {
        Key: ['VISA', 'CREDIT'],
      },
      Frequency: allMonthsYes(),
      Setting: {
        GLItemCode: 'VISA_DISC',
      },
      StatementSetting: {
        DisplayCount: 'Y',
        DisplayAmount: 'Y',
        DisplayRate: 'Y',
        StatementFeeDescription: 'Visa Credit Card Discount',
      },
      Pricing: {
        PercentWithPerItem: {
          DateRate: {
            StartDate: today,
            StopDate: '12/31/9999',
            Percent: mpaData.pricing.visaCreditRate,
            Amount: mpaData.pricing.visaCreditPerTxn || 0,
            CountChargeType: 'G', // Gross
            AmountChargeType: 'G',
          },
        },
      },
    });
  }

  // Visa Debit
  if (mpaData.pricing.visaDebitRate) {
    fees.push({
      FeeIdentity: {
        Category: 12,
        Name: 'Visa Debit Discount',
      },
      KeyStructure: {
        Key: ['VISA', 'DEBIT'],
      },
      Frequency: allMonthsYes(),
      Pricing: {
        PercentWithPerItem: {
          DateRate: {
            StartDate: today,
            StopDate: '12/31/9999',
            Percent: mpaData.pricing.visaDebitRate,
            Amount: mpaData.pricing.visaDebitPerTxn || 0,
            CountChargeType: 'G',
            AmountChargeType: 'G',
          },
        },
      },
    });
  }

  // Mastercard Credit
  if (mpaData.pricing.mcCreditRate) {
    fees.push({
      FeeIdentity: {
        Category: 12,
        Name: 'MC Credit Discount',
      },
      KeyStructure: {
        Key: ['MC', 'CREDIT'],
      },
      Frequency: allMonthsYes(),
      Pricing: {
        PercentWithPerItem: {
          DateRate: {
            StartDate: today,
            StopDate: '12/31/9999',
            Percent: mpaData.pricing.mcCreditRate,
            Amount: mpaData.pricing.mcCreditPerTxn || 0,
            CountChargeType: 'G',
            AmountChargeType: 'G',
          },
        },
      },
    });
  }

  // Discover Credit
  if (mpaData.pricing.discoverCreditRate) {
    fees.push({
      FeeIdentity: {
        Category: 12,
        Name: 'Discover Credit Discount',
      },
      KeyStructure: {
        Key: ['DISCOVER', 'CREDIT'],
      },
      Frequency: allMonthsYes(),
      Pricing: {
        PercentWithPerItem: {
          DateRate: {
            StartDate: today,
            StopDate: '12/31/9999',
            Percent: mpaData.pricing.discoverCreditRate,
            Amount: mpaData.pricing.discoverCreditPerTxn || 0,
            CountChargeType: 'G',
            AmountChargeType: 'G',
          },
        },
      },
    });
  }

  // Amex Credit
  if (mpaData.pricing.amexCreditRate) {
    fees.push({
      FeeIdentity: {
        Category: 12,
        Name: 'Amex Credit Discount',
      },
      KeyStructure: {
        Key: ['AMEX', 'CREDIT'],
      },
      Frequency: allMonthsYes(),
      Pricing: {
        PercentWithPerItem: {
          DateRate: {
            StartDate: today,
            StopDate: '12/31/9999',
            Percent: mpaData.pricing.amexCreditRate,
            Amount: mpaData.pricing.amexCreditPerTxn || 0,
            CountChargeType: 'G',
            AmountChargeType: 'G',
          },
        },
      },
    });
  }

  return fees;
}

function buildAuthorizationFees(mpaData: MPAData): PPMFee[] {
  const fees: PPMFee[] = [];
  const today = formatDate(new Date());

  if (mpaData.pricing.authFeePerTxn) {
    fees.push({
      FeeIdentity: {
        Category: 1, // Authorization Transactions
        Name: 'Auth Fee',
      },
      KeyStructure: {
        Key: ['ALL'],
      },
      Frequency: allMonthsYes(),
      Pricing: {
        PerItem: {
          DateRate: {
            StartDate: today,
            StopDate: '12/31/9999',
            Amount: mpaData.pricing.authFeePerTxn,
            CountChargeType: 'G',
          },
        },
      },
    });
  }

  return fees;
}

function buildMonthlyFees(mpaData: MPAData): PPMFee[] {
  const fees: PPMFee[] = [];
  const today = formatDate(new Date());

  // Monthly Account Fee
  if (mpaData.pricing.monthlyAccountFee) {
    fees.push({
      FeeIdentity: {
        Category: 9, // MISC Fixed Fees
        Name: 'Monthly Account Fee',
      },
      KeyStructure: {
        Key: ['MONTHLY'],
      },
      Frequency: allMonthsYes(),
      Setting: {
        GLItemCode: 'MONTHLY_FEE',
      },
      Pricing: {
        FixedRate: {
          DateRate: {
            StartDate: today,
            StopDate: '12/31/9999',
            Amount: mpaData.pricing.monthlyAccountFee,
          },
        },
      },
    });
  }

  // Statement Fee
  if (mpaData.pricing.statementFee) {
    fees.push({
      FeeIdentity: {
        Category: 9,
        Name: 'Statement Fee',
      },
      KeyStructure: {
        Key: ['STATEMENT'],
      },
      Frequency: allMonthsYes(),
      Pricing: {
        FixedRate: {
          DateRate: {
            StartDate: today,
            StopDate: '12/31/9999',
            Amount: mpaData.pricing.statementFee,
          },
        },
      },
    });
  }

  // PCI Compliance Fee
  if (mpaData.pricing.pciComplianceFee) {
    fees.push({
      FeeIdentity: {
        Category: 9,
        Name: 'PCI Compliance Fee',
      },
      KeyStructure: {
        Key: ['PCI'],
      },
      Frequency: allMonthsYes(),
      Pricing: {
        FixedRate: {
          DateRate: {
            StartDate: today,
            StopDate: '12/31/9999',
            Amount: mpaData.pricing.pciComplianceFee,
          },
        },
      },
    });
  }

  return fees;
}

function buildTransactionFees(mpaData: MPAData): PPMFee[] {
  const fees: PPMFee[] = [];
  const today = formatDate(new Date());

  // Batch Fee
  if (mpaData.pricing.batchFee) {
    fees.push({
      FeeIdentity: {
        Category: 4, // Data Capture Other
        Name: 'Batch Fee',
      },
      KeyStructure: {
        Key: ['BATCH'],
      },
      Frequency: allMonthsYes(),
      Pricing: {
        PerItem: {
          DateRate: {
            StartDate: today,
            StopDate: '12/31/9999',
            Amount: mpaData.pricing.batchFee,
            CountChargeType: 'G',
          },
        },
      },
    });
  }

  // Chargeback Fee
  if (mpaData.pricing.chargebackFee) {
    fees.push({
      FeeIdentity: {
        Category: 5, // Exceptions
        Name: 'Chargeback Fee',
      },
      KeyStructure: {
        Key: ['CHARGEBACK'],
      },
      Frequency: allMonthsYes(),
      Pricing: {
        PerItem: {
          DateRate: {
            StartDate: today,
            StopDate: '12/31/9999',
            Amount: mpaData.pricing.chargebackFee,
            CountChargeType: 'G',
          },
        },
      },
    });
  }

  // Retrieval Fee
  if (mpaData.pricing.retrievalFee) {
    fees.push({
      FeeIdentity: {
        Category: 5,
        Name: 'Retrieval Fee',
      },
      KeyStructure: {
        Key: ['RETRIEVAL'],
      },
      Frequency: allMonthsYes(),
      Pricing: {
        PerItem: {
          DateRate: {
            StartDate: today,
            StopDate: '12/31/9999',
            Amount: mpaData.pricing.retrievalFee,
            CountChargeType: 'G',
          },
        },
      },
    });
  }

  return fees;
}

// Helper functions
function formatDate(date: Date): string {
  const month = String(date.getMonth() + 1).padStart(2, '0');
  const day = String(date.getDate()).padStart(2, '0');
  const year = date.getFullYear();
  return `${month}/${day}/${year}`;
}

function allMonthsYes() {
  return {
    Jan: 'Y',
    Feb: 'Y',
    Mar: 'Y',
    Apr: 'Y',
    May: 'Y',
    Jun: 'Y',
    Jul: 'Y',
    Aug: 'Y',
    Sep: 'Y',
    Oct: 'Y',
    Nov: 'Y',
    Dec: 'Y',
  };
}
