  /**
   * Transform MPA data to PPM MerchantPricing request
   */
  static toPPMPricingRequest(
    bankNum: string,
    merchantNum: string,
    mpaData: MPAData
  ): MerchantPricingRequest {
    return {
      Merchant: {
        BankNum: bankNum,
