   */
  static toPPMDDARequest(
    bankNum: string,
    merchantNum: string,
    mpaData: MPAData
  ): MerchantDDARequest {
    const accounts: DDAAccount[] = [
      {
        TranType: 'P', // Primary
        AccountType: mpaData.bankAccount.accountType === 'checking' ? 'C' : 'S',
        DdaNumber: mpaData.bankAccount.accountNumber,
        TransitRouting: mpaData.bankAccount.routingNumber,
      },
