## Error Handling & Recovery

### 7.1 Error Classification

**Express API Errors:**
- **S515**: Missing required fields  Return field-level errors to user
- **S999**: Business rule violation  Return specific rule violation
- **S404**: Technical failure  Retry with exponential backoff
- **S405**: Record locked  Retry after delay
- **S711/S721**: Authentication failure  Alert dev team, check credentials

**PPM API Errors:**
- **Code 0**: Success  Continue
- **Merchant not found**: Merchant not in billing system  Verify Express boarding
- **Invalid key structure**: Key combo not valid  Log error, use default keys
- **Fee limit exceeded**: Too many fees  Remove optional fees, retry

### 7.2 Retry Strategy

```typescript
// src/lib/utils/retry.ts

export interface RetryOptions {
  maxAttempts: number;
  initialDelay: number;
  maxDelay: number;
  backoffFactor: number;
  retryableErrors?: string[];
}

export async function retryWithBackoff<T>(
  fn: () => Promise<T>,
  options: RetryOptions
): Promise<T> {
  let attempt = 0;
  let delay = options.initialDelay;

  while (attempt < options.maxAttempts) {
    try {
      return await fn();
    } catch (error) {
      attempt++;

      // Check if error is retryable
      if (
        options.retryableErrors &&
        !options.retryableErrors.includes(error.code)
      ) {
        throw error; // Not retryable
      }

      if (attempt >= options.maxAttempts) {
        throw error; // Max attempts reached
      }

      // Log retry attempt
      console.warn(`Attempt ${attempt} failed, retrying in ${delay}ms`, {
        error: error.message,
        code: error.code,
      });

      await sleep(delay);

      // Exponential backoff
      delay = Math.min(delay * options.backoffFactor, options.maxDelay);
    }
  }

  throw new Error('Retry loop exited unexpectedly');
}

// Usage
const response = await retryWithBackoff(
  () => expressClient.sendRequest('AddPPMMerchant', data),
  {
    maxAttempts: 3,
    initialDelay: 1000,
    maxDelay: 10000,
    backoffFactor: 2,
    retryableErrors: ['S404', 'S405', 'S406'],
  }
);
```

### 7.3 Recovery Workflows

**Express Account Creation Failed:**
1. Log error details to database
2. Mark MPA status as "Express Failed"
3. Notify user with error message
4. Provide "Retry" button in dashboard
5. Alert support team if critical error

**PPM Pricing Configuration Failed:**
1. Express account already created (safe)
2. Log PPM error details
3. Mark MPA status as "PPM Failed"
4. Option 1: Retry with same fees
5. Option 2: Retry with minimal fees (discount only)
6. Option 3: Manual intervention via support

**Partial Success Scenario:**
- Express:  Created
- PPM Pricing:  Created
- PPM DDA:  Failed

Recovery:
1. Mark onboarding as "Partially Complete"
2. Allow support to manually configure DDA
3. Re-validate after manual fix

