// src/lib/services/tsys-ppm/operations/save-merchant-dda.ts

export async function saveMerchantDDAFromMPA(
  client: TSYSPPMClient,
  bankNum: string,
  merchantNum: string,
  mpaData: MPAData
): Promise<MerchantDDAResponse> {
  const accounts: DDAAccount[] = [];

  // Primary settlement account
  accounts.push({
    TranType: 'P', // Primary
    AccountType: mpaData.bankAccount.accountType === 'checking' ? 'C' : 'S',
    DdaNumber: mpaData.bankAccount.accountNumber,
    TransitRouting: mpaData.bankAccount.routingNumber,
  });

  // Optional chargeback account (if different)
  if (mpaData.chargebackAccount) {
    accounts.push({
      TranType: 'C', // Chargeback
      AccountType: mpaData.chargebackAccount.accountType === 'checking' ? 'C' : 'S',
      DdaNumber: mpaData.chargebackAccount.accountNumber,
      TransitRouting: mpaData.chargebackAccount.routingNumber,
    });
  }

  const request: MerchantDDARequest = {
    Merchant: {
      BankNum: bankNum,
      MerchantNum: merchantNum,
    },
    DdaAccount: accounts,
  };

  return await client.saveMerchantDDA(request);
}
