### 2.4 Validation & Verification

```typescript
// src/lib/services/tsys-ppm/operations/validate-merchant-pricing.ts

export async function validateMerchantPricing(
  client: TSYSPPMClient,
  bankNum: string,
  merchantNum: string,
  expectedFeeCount: number
): Promise<ValidationResult> {
  const pricing = await client.getMerchantPricing(bankNum, merchantNum);

  const issues: string[] = [];

  // Check profile status
  if (pricing.MerchantPricing.BoardingStatus !== 'B') {
    issues.push(`Merchant not boarded: ${pricing.MerchantPricing.BoardingStatus}`);
  }

  // Check fee count
  const actualFeeCount = pricing.MerchantPricing.Fees?.Fee?.length || 0;
  if (actualFeeCount < expectedFeeCount) {
    issues.push(
      `Expected ${expectedFeeCount} fees, found ${actualFeeCount}`
    );
  }

  // Check for failed fees
  const failedFees = pricing.MerchantPricing.Fees?.Fee?.filter(
    (fee: any) => fee.Outcome?.Code !== 0
  ) || [];

  if (failedFees.length > 0) {
    issues.push(
      `${failedFees.length} fees failed: ${failedFees
        .map((f: any) => f.FeeIdentity.Name)
        .join(', ')}`
    );
  }

  return {
    valid: issues.length === 0,
    issues,
    pricing,
  };
}
