// src/lib/transformers/index.ts

export class MPATransformer {
  /**
   * Transform MPA data to Express AddPPMMerchant request
   */
  static toExpressRequest(mpaData: MPAData): AddPPMMerchantRequest {
    return {
      merchantDemographics: {
        legalBusinessName: mpaData.businessInfo.legalName,
        dbaName: mpaData.businessInfo.dbaName,
        entityType: this.mapEntityType(mpaData.businessInfo.entityType),
        taxId: mpaData.businessInfo.federalTaxId,
        mcc: mpaData.businessInfo.industryMCC,
        businessStartDate: formatDate(mpaData.businessInfo.startDate),
      },
      address: {
        physical: {
          street: mpaData.businessAddress.street,
          city: mpaData.businessAddress.city,
          state: mpaData.businessAddress.state,
          zip: mpaData.businessAddress.zip,
          country: mpaData.businessAddress.country || 'US',
          phone: mpaData.businessContact.phone,
        },
      },
      owner: {
        firstName: mpaData.ownerInfo.firstName,
        lastName: mpaData.ownerInfo.lastName,
        ssn: mpaData.ownerInfo.ssn,
        dob: formatDate(mpaData.ownerInfo.dateOfBirth),
        ownershipPercentage: mpaData.ownerInfo.ownershipPercentage,
        address: {
          street: mpaData.ownerInfo.homeAddress.street,
          city: mpaData.ownerInfo.homeAddress.city,
          state: mpaData.ownerInfo.homeAddress.state,
          zip: mpaData.ownerInfo.homeAddress.zip,
        },
      },
      dda: {
        accountNumber: mpaData.bankAccount.accountNumber,
        routingNumber: mpaData.bankAccount.routingNumber,
        accountType: mpaData.bankAccount.accountType === 'checking' ? 'C' : 'S',
      },
      processingInfo: {
        method: this.mapProcessingMethod(mpaData.processingInfo.method),
        annualVolume: mpaData.processingInfo.annualVolume,
        averageTicket: mpaData.processingInfo.averageTicket,
        highTicket: mpaData.processingInfo.highTicket,
      },
    };
  }

  /**
   * Transform MPA data to PPM MerchantPricing request
   */
  static toPPMPricingRequest(
    bankNum: string,
    merchantNum: string,
    mpaData: MPAData
  ): MerchantPricingRequest {
    return {
      Merchant: {
        BankNum: bankNum,
        MerchantNum: merchantNum,
      },
      MinimumDiscount: this.buildMinimumDiscount(mpaData),
      Fees: {
        Fee: [
          ...this.buildDiscountFees(mpaData),
          ...this.buildAuthorizationFees(mpaData),
          ...this.buildMonthlyFees(mpaData),
          ...this.buildTransactionFees(mpaData),
        ],
      },
    };
  }

  /**
   * Transform MPA data to PPM MerchantDDA request
   */
  static toPPMDDARequest(
    bankNum: string,
    merchantNum: string,
    mpaData: MPAData
  ): MerchantDDARequest {
    const accounts: DDAAccount[] = [
      {
        TranType: 'P', // Primary
        AccountType: mpaData.bankAccount.accountType === 'checking' ? 'C' : 'S',
        DdaNumber: mpaData.bankAccount.accountNumber,
        TransitRouting: mpaData.bankAccount.routingNumber,
      },
    ];

    if (mpaData.chargebackAccount) {
      accounts.push({
        TranType: 'C', // Chargeback
        AccountType: mpaData.chargebackAccount.accountType === 'checking' ? 'C' : 'S',
        DdaNumber: mpaData.chargebackAccount.accountNumber,
        TransitRouting: mpaData.chargebackAccount.routingNumber,
      });
    }

    return {
      Merchant: {
        BankNum: bankNum,
        MerchantNum: merchantNum,
      },
      DdaAccount: accounts,
    };
  }

