  private static mapEntityType(type: string): string {
    const mapping: Record<string, string> = {
      'Sole Proprietor': 'SOLE_PROP',
      'Corporation': 'CORP',
      'LLC': 'LLC',
      'Partnership': 'PARTNER',
      'Non-Profit': 'NON_PROFIT',
