### 10.3 Logging

```typescript
// src/lib/logging/api-logger.ts

export async function logAPICall(params: {
  mpaId: string;
  apiType: 'EXPRESS' | 'PPM';
  operation: string;
  request: any;
  response?: any;
  status: 'SUCCESS' | 'FAILED' | 'PENDING';
  errorMessage?: string;
}): Promise<void> {
  await db.insert(tsysAPILogs).values({
    mpa_id: params.mpaId,
    api_type: params.apiType,
    operation: params.operation,
    request_data: maskSensitiveData(params.request),
    response_data: params.response ? maskSensitiveData(params.response) : null,
    status: params.status,
    error_message: params.errorMessage,
  });
}

function maskSensitiveData(data: any): any {
  const masked = { ...data };

  // Mask SSN
  if (masked.owner?.ssn) {
    masked.owner.ssn = `***-**-${masked.owner.ssn.slice(-4)}`;
  }

  // Mask account number
  if (masked.dda?.accountNumber) {
    masked.dda.accountNumber = `****${masked.dda.accountNumber.slice(-4)}`;
  }

  // Mask full card numbers (if present)
  if (masked.cardNumber) {
    masked.cardNumber = `****-****-****-${masked.cardNumber.slice(-4)}`;
  }

  return masked;
}
