### E. Glossary

- **MPA**: Merchant Processing Application - The digital form merchants fill out
- **Express**: TSYS Express - Account creation and boarding system
- **PPM**: Portfolio Pricing Manager - Pricing and fee configuration system
- **BET**: Billing Element Table - Fee and pricing structure in Express
- **DDA**: Direct Deposit Account - Bank account for settlement
- **MCC**: Merchant Category Code - 4-digit industry classification
- **ERG**: Expense Rate Group - Expense tracking in PPM
- **BIN**: Bank Identification Number - Identifies acquiring bank
- **Boarding Status**: P=Pending, B=Boarded, D=Deactivated, C=Closed

